import React from 'react';

class Sizes extends React.Component{
  render(){

  const [ value1, setValue1 ] = React.useState(20);
  const [ value2, setValue2 ] = React.useState(50);
  const [ value3, setValue3 ] = React.useState(80);

  return (
    <Form>
      <Form.Group as={Row}>
        <Col xs="4">
          <Form.Control value={value1} size='sm'/>
        </Col>
        <Col xs="8">
          <RangeSlider
            value={value1}
            onChange={e => setValue1(e.target.value)}
            size='sm'
          />
        </Col>
      </Form.Group>
      <Form.Group as={Row}>
        <Col xs="4">
          <Form.Control value={value2}/>
        </Col>
        <Col xs="8">
          <RangeSlider
            value={value2}
            onChange={e => setValue2(e.target.value)}
          />
        </Col>
      </Form.Group>
      <Form.Group as={Row}>
        <Col xs="4">
          <Form.Control value={value3} size='lg'/>
        </Col>
        <Col xs="8">
          <RangeSlider
            value={value3}
            onChange={e => setValue3(e.target.value)}
            size='lg'
          />
        </Col>
      </Form.Group>
      </Form>
  );
}
};
export default Sizes
